import React from 'react';
// Import Icons
import { FaSearch, FaEnvelope, FaBell } from 'react-icons/fa';

// Dummy component
const MyHeader = props => {
	return (
		<header style={styles.myHeader}>
			<div style={styles.left}>
				<img src="" alt="" width="100" height="100" />
				<h1>01_Components</h1>
			</div>
			<div style={styles.searchCont}>
				<span style={styles.inputIcon}>
					<FaSearch />
				</span>
				<input type="text" placeholder="Search" style={styles.inputwithIcon} />
			</div>
			<div style={styles.rightSide}>
				<button style={styles.rightIcons}>
					<FaEnvelope />
				</button>
				<button style={styles.rightIcons}>
					<FaBell />
				</button>
				<img src="" alt="" width="100" height="100" />
			</div>
		</header>
	);
};

// Export
export default MyHeader;

// Styling with CSS-in-JS
const styles = {
	myHeader: {
		backgroundColor: 'black',
		padding: '10px',
		color: 'grey',
		display: 'flex',
		flexDirection: 'row',
		justifyContent: 'space-between',
		alignItems: 'center',
		boxShadow: '1px 6px 6px 1px grey',
	},
	left: {
		margin: 0,
		display: 'flex',
		flexDirection: 'row',
		justifyContent: 'space-between',
		alignItems: 'center',
	},
	searchCont: {
		border: '1px solid grey',
		display: 'flex',
		flexDirection: 'row',
		borderRadius: '2px',
		width: '40%',
	},
	inputIcon: {
		backgroundColor: '#ddd',
		padding: '10px',
		display: 'flex',
		alignItems: 'center',
		fontSize: '1rem',
	},
	inputwithIcon: {
		border: 'none',
		flex: '1',
		padding: '10px',
	},
	rightSide: {
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'center',
		marginRight: '10px',
	},
	rightIcons: {},
};
